Science on Track is a hands-on, creative experience for all ages, where visitors build and test their own creations relating to energy, forces and motion, learn about railway science and technology, and get hands-on with our interactive Science Station exhibition.  

For: All ages

Event Price: 
Entry is free to annual pass holders, under 3s and Queensland school students.
Other entry fee details: 
Family (2 adults & up to 4 children) $63; 
General adult admission $21; 
Concession (on presentation of a Concession Card) $18; 
Child (ages 3 to 15) $12.
